def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.2:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) + np.tan(item) + np.tan(bins[i])
        elif ratios[i] >= 0.2 and ratios[i] < 0.4:
            priorities[i] = np.log(np.abs(item - bins[i]) + 1) * np.arctan(np.sqrt(item * bins[i]))
        elif ratios[i] >= 0.4 and ratios[i] < 0.6:
            priorities[i] = np.cosh(np.exp(ratios[i])) * np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1) + np.sin(item) * np.cos(bins[i])
        elif ratios[i] >= 0.6 and ratios[i] < 0.8:
            priorities[i] = np.tanh(np.arcsin(np.sqrt(item) + np.sqrt(bins[i]))) + np.e * np.arcsin(ratios[i])
        else:
            priorities[i] = np.arccos(np.tan(item - bins[i]) / np.pi * np.exp(ratios[i]))

    return priorities
